import React from "react";
import { Table } from "antd";

const { Column } = Table;
// import { columns } from "./columns";
const DishTable = ({ data, name, price, type }) => {
  return (
    <Table dataSource={data} bordered pagination={false} scroll={{ y: 500 }}>
      <Column title={name} />
      <Column title={price} />
      <Column title={type} />
    </Table>
  );
};

export default DishTable;
